@MaxBlumenthal @dk564 Dec 12, 2013
Ukr President Yanukovych escaped protests with a state visit to Beijing, where he received China’s pledge to protect Ukraine under its nuclear umbrella.

Dec. 5, 2013 Yanukovych &amp; Xi Jinping signed a treaty officially pronouncing China &amp; Ukraine strategic partners.

